import React from 'react';
import {BrowserRouter as Router} from 'react-router-dom'
import {useRoutes} from './routes'


import AuthPage from './pages/AuthPage'

const App = () => {

  const routes = useRoutes(false)

  return (
    <div className="container">
      <Router>
        {routes}
      </Router>

    </div>
  )
}

export default App
